import PropTypes from 'prop-types'

const Header = ({title}) => {
  return (
    <header>
        <h1 style={{color: 'red', backgroundColor:'black'}}>{title}</h1>
    </header>
  )
}
Header.defaultProps = {
    title : 'Task Tracker by Abhi',
}

Header.propTyped = {
    title: PropTypes.string.isRequired,
}
export default Header
